import React from 'react';

const Titulo = ({color, texto, children}) => { 
  return <h1 style={{ color: color }}>{props.texto}<br></br>{props.children}</h1>; 
};

const App = () => {
  return (
    <React.Fragment>
      <Titulo color="red" texto="heloow">
        Isso é um children
      </Titulo>
      <Titulo color="darkBlue" texto="heloow" />
    </React.Fragment>
  );
};

export default App;
